&lt;!-- Create a div for each card --&gt;
&lt;div class="card"&gt;
  &lt;!-- Add a header for the card --&gt;
  &lt;div class="card-header"&gt;Nature&lt;/div&gt;
  &lt;!-- Add an image for the card --&gt;
  &lt;img src="https://source.unsplash.com/random/300x300?nature" alt="Nature" class="card-image"&gt;
  &lt;!-- Add some text for the card --&gt;
  &lt;div class="card-text"&gt;This is a card about nature. Nature is the natural, physical, material world or universe.&lt;/div&gt;
&lt;/div&gt;
&lt;div class="card"&gt;
  &lt;div class="card-header"&gt;City&lt;/div&gt;
  &lt;img src="https://source.unsplash.com/random/300x300?city" alt="City" class="card-image"&gt;
  &lt;div class="card-text"&gt;This is a card about city. A city is a large human settlement with extensive systems for housing, transportation, sanitation, utilities, land use, and communication.&lt;/div&gt;
&lt;/div&gt;


&lt;div class="card"&gt;
  &lt;div class="card-header"&gt;Animal&lt;/div&gt;
  &lt;img src="https://source.unsplash.com/random/300x300?animal" alt="Animal" class="card-image"&gt;
  &lt;div class="card-text"&gt;This is a card about animal. An animal is a living organism that feeds on organic matter, typically having specialized sense organs and nervous system and able to respond rapidly to stimuli.&lt;/div&gt;
&lt;/div&gt;
&lt;div class="card"&gt;
  &lt;div class="card-header"&gt;Food&lt;/div&gt;
  &lt;img src="https://source.unsplash.com/random/300x300?food" alt="Food" class="card-image"&gt;
  &lt;div class="card-text"&gt;This is a card about food. Food is any substance consumed to provide nutritional support for an organism. Food is usually of plant, animal or fungal origin, and contains essential nutrients.&lt;/div&gt;
&lt;/div&gt;

